Comment:
This song was made with Timberlake's blueprint to begin with, so not surprised that he fits here like a haute couture glove. I still don't think the song itself is particularly good, but his verse definitely made me put it on repeat for a good 30 minutes.

&#x200B;

Timberlake continues to never disappoint on a feature. I mean people still think that Signs is a Justin Timberlake song.
